    const {sharedUsers} = useShareContext();

    const onPermissionChange = (val) => {
        console.lof(val);
    }

    return (<div style={{marginBottom: '40px'}} >
                {
                    _userToShareMember(sharedUsers).map((user) => {
                        return <SharedMember onPermissionChange={onPermissionChange} text={user.text} subText={user.subText} />
                    })
                }
        </div>)
}

export default SharedMembers;
